Special trip to Malibu to start the long weekend. 

Happy dog summer program breakdown.

**Early Morning hikes**

Pick up before 7am and drop off  is around 10 am.
Early morning pick ups are a great option for dogs that have a propensity to overheat. 
--The main advantage to the early morning pick up is the cooler ground and the opportunity to use the trails. Later in the day the ground on the trails is way to hot to for the dogs. 
--The rate is the same rate as the midday outings. 

**Midday dog daycare**
Pick up around 10am 
--Currently we are staying off the trails and switching to areas with shade during our walks.
-- Midday activities places strong emphasis on covering a substantial distance on our hikes, practicing structure walks and promoting enjoyable social interactions. A format design to enhance the dog's development process while taking advantage of the beautiful LA mountain trails and gorgeous urban landscape.

**Premium Dog Daycare**
Morning hike and midday activity combination. For the working dog that needs multiple activities during the day. Pick up in the early morning and drop in the late afternoon.

Happy dog Training program:

Early morning and midday dog training combination. 
. 
